import React, {useState} from "react";
import {Routes, Route, useLocation} from "react-router-dom";
import Container from "@mui/material/Container";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";

import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";
import CardMedia from "@mui/material/CardMedia";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import {List} from "@mui/material";
import ListItemText from "@mui/material/ListItemText";

export const TestRoute = (props) => {
  const location = useLocation();
  const propsData = location.state;
  return (
    <Container maxWidth="md" sx={{p: 5}}>
      <Box sx={{bgcolor: "#cfe8fc", height: "100vh", borderRadius: "15px"}}>
        <Grid container spacing={3} sx={{p: 5}}>
          <Grid item xs={6} md={6} sx={{}}>
            <Card>
              <CardMedia
                component="img"
                height="140"
                image={propsData.profile_image_url}
                alt="green iguana"
              />
              <CardContent>
                <List
                  sx={{
                    width: "100%",
                    maxWidth: 360,
                    bgcolor: "background.paper",
                  }}>
                  <ListItemText
                    primary={propsData.name}
                    sx={{fontWeight: "Light"}}
                  />
                </List>
                <Typography variant="body2" color="text.secondary">
                  Address: {propsData.address}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  Opening Huor:
                  {propsData.operation_time.map((item, index) => (
                    <ul key={index}>
                      <li style={{display: "inline", marginLeft: "2px"}}>
                        {`${item.day}`}
                        {item.time_open === "closed"
                          ? " : Closed"
                          : ` : ${item.time_open} -  ${item.time_close}`}
                      </li>
                    </ul>
                  ))}
                </Typography>
              </CardContent>
            </Card>
          </Grid>
          <Grid item xs={6} md={6} sx={{}}>
            <Card>123</Card>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};
